class Tolls:
    def __init__(self, tolls):
        self.rows = len(tolls)
        self.cols = len(tolls[0])
        self.tolls = {(r, c): tolls[r][c] for r in range(self.rows) for c in range(self.cols)}
        self.came_from = {}
        self.g_score = {}

    def get_g(self, node):
        return self.g_score.get(node, float('inf'))

    def set_g(self, node, value):
        self.g_score[node] = value

    def reconstruct_path(self, node):
        total_path = []
        while True:
            next_node = self.came_from.get(node, None)
            if next_node:
                diffx, diffy = (node[0]-next_node[0], node[1]-next_node[1])
                if diffx == 1:
                    insertword = 'down'
                elif diffx == -1:
                    insertword = 'up'
                elif diffy == 1:
                    insertword = 'right'
                elif diffy == -1:
                    insertword = 'left'
                else:
                    break
                node = next_node
                total_path.insert(0, insertword)
            else:
                break
        return total_path

    def get_neighborhood(self, node):
        return_list = []
        for move in [(-1, 0), (0, -1), (1, 0), (0, 1)]:
            test = (node[0]+move[0], node[1]+move[1])
            if (0 <= test[0] < self.rows) and (0 <= test[1] < self.cols):
                return_list.append(test)
        return return_list

def find_path(t, start, finish):
    tolls = Tolls(t)
    open_set = [start]
    tolls.set_g(start, 0)
    
    while open_set:
        current = open_set[0]
        if current == finish:
            return tolls.reconstruct_path(current)
        open_set.remove(current)
        for neighbor in tolls.get_neighborhood(current):
            tent_g = tolls.get_g(current) + tolls.tolls[neighbor]
            if tent_g < tolls.get_g(neighbor):
                tolls.came_from[neighbor] = current
                tolls.set_g(neighbor, tent_g)
                if neighbor not in open_set:
                    open_set.append(neighbor)
                    open_set.sort(key=lambda x:tolls.get_g(x))
    return False

